👉Herzliche Einladung!
Morgen bin ich in Herzogenaurach zum Austausch über die Situation von Kindern und Jugendlichen und deren psychischer Gesundheit nach Corona;

👉ich bin dort im Gespräch mit dem Herzogenauracher Kinder- und Jugendarzt Karsten Naumann;

👉als Beraterin in der Chatseelsorge begegne ich regelmäßig jungen Menschen, die mir von ihren Ängsten und Nöten berichten;

👉Ich freue mich und bin gespannt auf den Austausch!

#gruene_herzogenaurach #gruene_erh @christianzwanziger @manfred_bachmayer #kinderundjugendtherapie #kinder #jugendliche #jugendsozialarbeit #kindergesundheit

Am vergangenen Dienstag durfte ich eine spannende Diskussion beim Mitgliederforum meines CSU-Kreisverbandes Schwabing zum Thema „Bezahlbares Wohnen in München - Was kann die Politik tun?“ moderieren.
Mit vielen Mitgliedern, Mandatsträgern wie Stadtrat @tomtank165, den Landtagsabgeordneten @lspaenle und @josef.schmid.969 sowie dem Bundestagsabgeordneten @wolfgangstefinger und Experten aus der ganzen Welt haben wir uns ausgetauscht.
Aus all den Ideen und Anregungen er arbeiten wir ein Positionspapier.

