Gemeinsam Spaß haben und feiern und dabei die Kultur des Nachbarlands kennenlernen: Eröffnung des deutsch-tschechischen Jugendsommercamps der EUREGIO EGRENSIS im oberfränkischen Selb im Fichtelgebirge. Die Beziehungen zu Tschechen waren noch nie so gut und vertrauensvoll wie zur Zeit. Damit sich das Stück für Stück noch weiter verbessert, ist es wichtig, dass die Menschen und vor allem unsere Kinder und Jugendlichen in unseren Grenzregionen Einblick in Kultur und Gesellschaft des Nachbarlandes bekommen und Sprachkenntnisse erwerben. Unsere Stiftung Jugendaustausch Bayern ermöglicht genau das. Wir haben die Stiftung vor zwei Jahren unter anderem mit dem Ziel gegründet, den #Jugendaustausch zwischen Bayern und Tschechien zu verstärken. Alle bayerischen Kinder und Jugendlichen sollen die Möglichkeit haben, mal eine Zeit im Ausland zu verbringen.

