Hey, schreibt mal, welche Rolle Kreativität und Erfindungsreichtum in der Schule spielen sollten und, wie es eurer Ansicht nach darum steht. 

Wir leben in extrem herausfordernden Zeiten, die nach Veränderung verlangen. Dabei ist Innovation, sind neue Ideen dringender gesucht, denn je.

Neue Ideen haben etwas mit Experimentieren zu tun, mit Versuch und Irrtum, mit Raum und Zeit, Dinge selbst auszuprobieren.

Gibt es dazu an eurer Schule Gelegenheit? Wenn ja in welcher Form?

Bitte teilt die Frage/den Beitrag mit Freund:innen.

